import React, {Component} from 'react';
import Typewriter from "typewriter-effect";
import './Home.css';
import Navbar from './Navbar';

class Home extends Component {
    render() {
        return (
            <div>
                <Navbar page="home"/>
                <div className="homepage">
                    <div className="introduction">
                        Hi, I'm Marc,
                    </div>
                    <div className="emojiContainer">
                        <div id="emoji"> 
                            &#128512;
                        </div>
                        <div className="shadow"></div>
                    </div>
                    <div className="description">
                        <Typewriter
                            options={{
                                strings: ['an eager developer', 'a blockchain enthusiast', 'a nighttime gym rat', 'an nft collector', 'a Lakers fan'],
                                delay: 75,
                                deleteSpeed: 70,
                                pauseFor: 1800,
                                autoStart: true,
                                loop: true,
                            }}
                        />
                    </div>
                </div>
            </div>
        );
    }
}

export default Home;
